import React from "react";
import { NavLink } from "react-router-dom";
import styled from "styled-components";

const DialogItem = () => {
  return (
    <DialogItemStyled>
      <NavLink to={"/dialogs/1"}>Danila</NavLink>
    </DialogItemStyled>
  );
};

export default DialogItem

const DialogItemStyled = styled.div`
  & a.active {
    color: cyan;
  }
`;
